import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          My app Header
        </p>
      </header>

      <div className="contant-div">
        <p>My contant</p>
      </div>

      <footer className="app-footer">
        <p>My app Footer</p>
      </footer>



    </div>
  );
}

export default App;
